_module.directive('uiSelectFocusOn', function ($timeout) {
  return {
    restrict: 'A',
    require: 'uiSelect',
    link: function link(scope, elem, attrs, uiSelect) {
      scope.$on(attrs.uiSelectFocusOn, function () {
        $timeout(function () {
          return uiSelect.activate();
        });
      });
    }
  };
});
